Mir ist aufgefallen, dass im neuen Spielmodus die Sph&auml;ren von Sternenw&auml;chterin Syndra, die um sie kreisen, ab Runde 4 nicht mehr wie Multi, sondern wie im normalen Skin aussehen. Sobald man stirbt und wiederbelebt wird, erscheinen die kleinen Wesen wieder... Ist das auch mal jemandem aufgefallen?

Das ganze ist gut sichtbar ab ca. 7 Minuten im angeh&auml;ngten YouTube Video. Ab 13 Minuten taucht Multi nach der Wiederbelebung wieder auf.
